import React, { useEffect, useState } from 'react';
function User(){
  const [count,setCount] = useState(0);
  const [like,setLike] = useState(0);
  useEffect(()=>{
    setCount(()=>(count+1))
  },[]);
  useEffect(()=>{
    setLike(()=>(like+1))
  },[]);
  const users = [
    {
      
      avata: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQdoTDc4GgUuLDtw0iTwJSKXPn5PSiXPIawMw&usqp=CAU",
    }
  ];

  return (
    <div>
      {users.map((user, index) => (
        <div key={index} className='div-table'>
          <img className='img1' src={user.avata} style={{ width: '200px', height: '200px' }} />
          {/* <br> */}
          <button onClick={() => setLike(like + 1)}>üëç {like}</button>
          <button onClick={() => setCount(count + 1)}>üëé {count}</button>
        </div>
      ))}
    </div>
  );
}

export default User;
